$('.has-child').click(function() {
	$('.has-child').not($(this)).find('.dropdown').stop(true,false,true).slideUp(500);
	$('.has-child').not($(this)).find('.chev').removeClass('rotate');

	$(this).find('.dropdown').stop(true,false,true).slideToggle(500);
	$(this).find('.chev').toggleClass('rotate');

});


function AjaxRequest(url,data)
{
    var res;
    $.ajax({
        url: url,
        data: data,
        async: false,
        error: function() {
        console.log('error');
        },
        dataType: 'json',
        success: function(data) {
        res= data;

        },
        type: 'POST'
        });

    return res;
}

function AjaxRequest_get(url, data) {
    var res;
    $.ajax({
        url: url,
        data: data,
        async: false,
        type: 'GET',
        dataType: 'json',
        success: function(data) {
            res = data;

        },
        error: function() {
            console.log('error');
        }

    });
    return res;
}

